CREATE DEFINER=`root`@`localhost` PROCEDURE `week_early`(IN date_from DATE, IN date_to DATE)
BEGIN
SELECT emp_code, COUNT(tdiff) as early
FROM (SELECT a.emp_code, 
		a.date_log,
        TIME(a.time_in) as time_in,
        COALESCE(b.time_in,
				'08:00:00') as shift_start,
        TIMEDIFF(TIME(a.time_in), 
        COALESCE(b.time_in,
				'08:00:00')) as tdiff
FROM rgc_webportal.attendance a
LEFT JOIN employee_shifts b ON a.emp_code = b.emp_no
AND a.date_log = b.shift_date
WHERE a.date_log BETWEEN date_from AND date_to) as week_early
WHERE tdiff <= '01:00:00'
GROUP BY emp_code
ORDER BY early DESC
LIMIT 0,5;
END ;;
